(function () {
    "use strict";


    document.addEventListener('DOMContentLoaded', function () {

        var print = document.querySelector('#printBluetooth')
        var printLabel = document.querySelector('#printLabelBluetooth')

	var imagebase64 = [];
	imagebase64[0] ="";
	imagebase64[1] ="";
	imagebase64[2] ="";
	
	imagebase64[3] = ""
	
        print.addEventListener('click', function () {
			var index = Math.floor(Math.random()*3)
			console.log(index);
			var sel = document.getElementById('pairOptions');
			window.androidInjectSetting.printWithBluetoothPrinter(sel.value,imagebase64[index]);

        }); 
		
		printLabel.addEventListener('click', function () {
			window.androidInjectSetting.printWithBluetoothPrinter(imagebase64[3]);
        }); 

        console.log('Page loaded');

    });


})();
